import {
    MapContainer,
    TileLayer,
    Marker, 
    Popup
  } from 'react-leaflet'
import axios from 'axios'
import React, { useState, useEffect } from 'react';

const position = [35.75, -79.0193]

export default function Map() {
    const [base, setBase] = useState(null);
    const [county, setCounty] = useState(null);
    const [state, setState] = useState(null);

    useEffect(() => {
        axios.get("http://localhost:5000/map").then((res) => {
            setBase(res.data.image);
            setCounty(res.data.county);
            setCounty(res.data.state);
         })
      }, []);


    return (
        <MapContainer style={{backgroundColor: "black",height: "100vh", width: "100vw"}} center={{lat: 35.938, lng:-79.81}} zoom={10}>
            {base ?
             <TileLayer
                url={base}
            /> : null}
            {county ?
             <TileLayer
                url={county}
            /> : null}
            {county ?
             <TileLayer
                url={county}
            /> : null}

        <Marker position={position} iconSize={[38, 95]}>
            <Popup>
            A pretty CSS3 popup. <br /> Easily customizable.
            </Popup>
        </Marker>

        </MapContainer>
    )
}
